import React from 'react';

class Name extends React.Component {
  render() {
     const { nome, handlerGenerico } = this.props;
    return(
    <input 
      type='text' 
      name='nome' 
      value={ nome } 
      onChange={ handlerGenerico } 
    />
    )
  }
}

export default Name;
